function getColumnValue(rowNode, column) {
	let node = rowNode.querySelectorAll('td[class*="'+column+'"] div')[0];
	return node?.textContent?.toLowerCase()?.trim();
}

function truncateNumber(rowNode, column) {
	let node = rowNode.querySelectorAll('td[class*="'+column+'"] div')[0];
	let text = node?.textContent?.toLowerCase()?.trim();
	
	if(text.indexOf('.') != -1) {
		node.textContent = text.substring(0, text.indexOf('.')+3);
	}
}

function flagColumn(rowNode, column) {
	try {
	let node = rowNode.querySelectorAll('td[class*="'+column+'"] div')[0];
	node.style['color'] = 'red';
	node.setAttribute('dupe', 'true');
	} catch(e) { }
}

// Records we've displayed already
let savedNodes = [];

// Swaps we've identified as wanting to show modifications to
let discoveredIdentifiers = [];

function setOutput() {
	
	let allRows = document.querySelectorAll('table.mat-ticker-table-2:not([cstm-dupe=true]) tbody tr');

	allRows.forEach(node => {
		let actionType                 = getColumnValue(node, 'actionType');
		let disseminationIdentifier    = getColumnValue(node, 'disseminationIdentifier');
		let ogDisseminationIdentifier  = getColumnValue(node, 'originalDisseminationIdentifier');
		let notionalAmountLeg1         = parseInt(getColumnValue(node, 'notionalAmountLeg1').replaceAll(',',''),10);
		let notionalCurrencyLeg1       = getColumnValue(node, 'notionalCurrencyLeg1');
		let upiFISN                    = getColumnValue(node, 'uniqueProductIdentifierShortName');
		let upiLongName                = getColumnValue(node, 'uniqueProductIdentifierUnderlierName');
		let uniqueProductIdentifier    = getColumnValue(node, 'uniqueProductIdentifier');
		let underlierIDLeg1            = getColumnValue(node, 'underlierIDLeg1');
		let underlierIDLeg2            = getColumnValue(node, 'underlierIDLeg2');
		let price            		   = parseInt(getColumnValue(node, 'price').replaceAll(',',''), 10);
		let settlementLocationLeg1     = getColumnValue(node, 'settlementLocationLeg1');
		let settlementLocationLeg2     = getColumnValue(node, 'settlementLocationLeg2');
		let includeInResults           = false;
		let singleStock				   = false;
		
		truncateNumber(node, 'price');

		// If we've already pushed this record into the log, let's ignore it
		if(savedNodes.includes(disseminationIdentifier)) {
			return;
		}
		
		if(actionType?.includes('EROR'.toLowerCase())) {node.className += ' ignore';return;}		
		
		// Attempt to ignore index swaps
		if(upiFISN.includes('NA/SWAPS IDX TOT RTN'.toLowerCase())) {node.className += ' ignore';return;}
		if(upiFISN.includes('NA/SWAPS IDX PR'.toLowerCase())) {node.className += ' ignore';return;}
		if(upiFISN.includes('NA/O IDX '.toLowerCase())) {node.className += ' ignore';return;}
		if(upiFISN.includes('SWAPS NSTD IDX'.toLowerCase())) {node.className += ' ignore';return;}
		
		if(upiLongName.includes('S&P 500 INDEX'.toLowerCase())) {node.className += ' ignore';return;}


		// Ignore certain currencies for now
		if(notionalCurrencyLeg1.includes('jpy')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('hkd')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('try')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('krw')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('chf')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('dkk')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('sek')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('nok')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('zar')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('myr')) {node.className += ' ignore';return;}
		if(notionalCurrencyLeg1.includes('thb')) {node.className += ' ignore';return;}
		
		if(upiFISN.includes(' SSTK '.toLowerCase())) { singleStock = true; }
		if(upiFISN.includes('SGLE STK'.toLowerCase())) { singleStock = true; }

		if(universalProductIdentifiers.includes(uniqueProductIdentifier.toLowerCase())) {
			flagColumn(node, 'uniqueProductIdentifier');
			includeInResults = true;
		}
		
		if(disseminationIdentifiers.includes(disseminationIdentifier)) {
			flagColumn(node, 'disseminationIdentifier');
			includeInResults = true;
		}
		
		if(ogDisseminationIdentifier.match('[0-9]+') != null) {
			if(disseminationIdentifiers.includes(ogDisseminationIdentifier)) {
				flagColumn(node, 'originalDisseminationIdentifier');
				includeInResults = true;
			} else if(discoveredIdentifiers.includes(ogDisseminationIdentifier)) {
				includeInResults = true;
			}
		}

		underliers.forEach(function(underlier) {
			if(underlierIDLeg1?.includes(underlier.toLowerCase()))        {flagColumn(node, 'underlierIDLeg1'); includeInResults = true;}
			if(underlierIDLeg2?.includes(underlier.toLowerCase()))        {flagColumn(node, 'underlierIDLeg1'); includeInResults = true;}
			if(settlementLocationLeg1?.includes(underlier.toLowerCase())) {flagColumn(node, 'underlierIDLeg1'); includeInResults = true;}
			if(settlementLocationLeg2?.includes(underlier.toLowerCase())) {flagColumn(node, 'underlierIDLeg1'); includeInResults = true;}
		});
		
		// If it's a single stock, but we haven't found any of our identifiers, we don't want value to be the marker for inclusion
		// value is largely there to pick up baskets
		if(singleStock && !includeInResults) {node.className += ' ignore';return;}
		
		if((notionalCurrencyLeg1.includes('usd') || notionalCurrencyLeg1.includes('gbp') || notionalCurrencyLeg1.includes('eur') || notionalCurrencyLeg1.includes('cad')) && (notionalAmountLeg1 >= 100000000 || notionalAmountLeg1 < 0)) {
			flagColumn(node, 'notionalAmountLeg1');
			includeInResults = true;
		}
		
		if((notionalCurrencyLeg1.includes('usd') || notionalCurrencyLeg1.includes('gbp') || notionalCurrencyLeg1.includes('eur') || notionalCurrencyLeg1.includes('cad')) && (price >= 100000000 || price < 0)) {
			flagColumn(node, 'price');
			includeInResults = true;
		}

		// Once we've flagged a swap for inclusion, let's continue to keep track of it
		if(includeInResults) {
			savedNodes.push(disseminationIdentifier);
			
			if(ogDisseminationIdentifier.match('[0-9]+') != null) {
				discoveredIdentifiers.push(ogDisseminationIdentifier);
			} else {
				discoveredIdentifiers.push(disseminationIdentifier);
			}
		}
	});


	let dupeNodes = document.querySelectorAll('table.mat-ticker-table-2:not([cstm-dupe=true]) tr:has(*[dupe=true])');
	let tbody     = document.querySelectorAll('table.mat-ticker-table-2[cstm-dupe=true] tbody')[0];

	dupeNodes.forEach(node => {
		tbody.insertBefore(node.cloneNode(true), tbody.childNodes[0]);
	});
}

let timeoutID;
const callback = (mutationList, observer) => {
	for (const mutation of mutationList) {
		if (mutation.type === "childList") {
			clearTimeout(timeoutID);
			timeoutID = setTimeout(setOutput, 100);
		} 
	}
};

